NTGreekWord.create({strong_id: 2719, normalized_form: "κατεσθιω", form: "κατεσθίω", pos: "Verb", transliteration: "katesthió", phonetic_spelling: "(kat-es-thee'-o)", short_definition: "I eat till it is finished", medium_definition: "I eat up, eat till it is finished, devour, squander, annoy, injure.", long_definition: " from kata - kata <a>2068</a> (including its alternate); to eat down, i.e. devour (literally or figuratively):--devour." })
