NTGreekWord.create({strong_id: 2725, normalized_form: "κατηγορος", form: "κατήγορος, ου, ὁ", pos: "Noun, Masculine", transliteration: "kategoros", phonetic_spelling: "(kat-ay'-gor-os)", short_definition: "a prosecutor, accuser", medium_definition: "an accuser, prosecutor.", long_definition: " from kata - kata <a>58</a>; against one in the assembly, i.e. a complainant at law; specially, Satan:--accuser." })
