NTGreekWord.create({strong_id: 2728, normalized_form: "κατιοω", form: "κατιόω", pos: "Verb", transliteration: "katioó", phonetic_spelling: "(kat-ee-o'-o)", short_definition: "I rust", medium_definition: "I rust; pass: I am rusted, tarnished.", long_definition: " from kata - kata <a>2447</a>; to rust down, i.e. corrode:--canker." })
