NTGreekWord.create({strong_id: 2732, normalized_form: "κατοικητηριον", form: "κατοικητήριον, ου, τό", pos: "Noun, Neuter", transliteration: "katoikétérion", phonetic_spelling: "(kat-oy-kay-tay'-ree-on)", short_definition: "a habitation, dwelling-place", medium_definition: "a habitation, dwelling-place, abode.", long_definition: " from a derivative of katoikew - katoikeo <a>2730</a>; a dwelling-place:--habitation." })
