NTGreekWord.create({strong_id: 2830, normalized_form: "κλυδων", form: "κλύδων, ῶνος, ὁ", pos: "Noun, Masculine", transliteration: "kludón", phonetic_spelling: "(kloo'-dohn)", short_definition: "rough water", medium_definition: "rough water, a wave, billow, surge.", long_definition: " from kluzo (to billow or dash over); a surge of the sea (literally or figuratively):--raging, wave." })
NTGreekWord.create({strong_id: 2831, normalized_form: "κλυδωνιζομαι", form: "κλυδωνίζομαι", pos: "Verb", transliteration: "kludónizomai", phonetic_spelling: "(kloo-do-nid'-zom-ahee)", short_definition: "I am tossed by waves", medium_definition: "I am tossed by waves, met: I am tossed to and fro.", long_definition: " middle voice from kludwn - kludon <a>2830</a>; to surge, i.e. (figuratively) to fluctuate:--toss to and fro." })
NTGreekWord.create({strong_id: 2832, normalized_form: "Κλωπας", form: "Κλωπᾶς, ᾶ, ὁ", pos: "Noun, Masculine", transliteration: "Klópas", phonetic_spelling: "(klo-pas')", short_definition: "Clopas", medium_definition: "Clopas, husband of one Mary, who stood by the cross.", long_definition: " of Chaldee origin (corresponding to 'Ach'ab <a>256</a>; Clopas, an Israelite:--Cleophas." })
NTGreekWord.create({strong_id: 2833, normalized_form: "κνηθω", form: "κνήθω", pos: "Verb", transliteration: "knéthó", phonetic_spelling: "(knay'-tho)", short_definition: "I rub, tickle", medium_definition: "I rub, tickle, scratch; pass: I itch.", long_definition: " from a primary knao (to scrape); to scratch, i.e. (by implication) to tickle:--X itching." })
NTGreekWord.create({strong_id: 2834, normalized_form: "Κνιδος", form: "Κνίδος, ου, ἡ", pos: "Noun, Feminine", transliteration: "Knidos", phonetic_spelling: "(knee'-dos)", short_definition: "Cnidus", medium_definition: "Cnidus, a town on the coast of Caria (south-west Asia Minor) near the island of Cos.", long_definition: " probably of foreign origin; Cnidus, a place in Asia Minor:--Cnidus." })
NTGreekWord.create({strong_id: 2835, normalized_form: "κοδραντης", form: "κοδράντης, ου, ὁ", pos: "Noun, Masculine", transliteration: "kodrantés", phonetic_spelling: "(kod-ran'-tace)", short_definition: "the smallest Roman copper coin", medium_definition: "a quadrans, the smallest Roman copper coin, a quarter of an as, the sixteenth part of a sesterius.", long_definition: " of Latin origin; a quadrans, i.e. the fourth part of an as:--farthing." })
NTGreekWord.create({strong_id: 2836, normalized_form: "κοιλια", form: "κοιλία, ας, ἡ", pos: "Noun, Feminine", transliteration: "koilia", phonetic_spelling: "(koy-lee'-ah)", short_definition: "belly, womb, the inner man", medium_definition: "belly, abdomen, heart, a general term covering any organ in the abdomen, e.g. stomach, womb; met: the inner man.", long_definition: " from koilos (\"hollow\"); a cavity, i.e. (especially) the abdomen; by implication, the matrix; figuratively, the heart:--belly, womb." })
NTGreekWord.create({strong_id: 2837, normalized_form: "κοιμαομαι", form: "κοιμάομαι", pos: "Verb", transliteration: "koimaó from NG2749", phonetic_spelling: "(koy-mah'-o)", short_definition: "I fall asleep, am asleep", medium_definition: "I fall asleep, am asleep, sometimes of the sleep of death.", long_definition: " from keimai - keimai <a>2749</a>; to put to sleep, i.e. (passively or reflexively) to slumber; figuratively, to decease:--(be a-, fall a-, fall on) sleep, be dead." })
NTGreekWord.create({strong_id: 2838, normalized_form: "κοιμησις", form: "κοίμησις, εως, ἡ", pos: "Noun, Feminine", transliteration: "koimésis", phonetic_spelling: "(koy'-may-sis)", short_definition: "repose, taking rest", medium_definition: "repose, taking rest, sleep.", long_definition: " from koimaw - koimao <a>2837</a>; sleeping, i.e. (by implication) repose:--taking of rest." })
NTGreekWord.create({strong_id: 2839, normalized_form: "κοινος", form: "κοινός, ή, όν", pos: "Adjective", transliteration: "koinos", phonetic_spelling: "(koy-nos')", short_definition: "common, shared, unclean", medium_definition: "(a) common, shared, (b) Hebraistic use: profane; dirty, unclean, unwashed.", long_definition: " probably from sun - sun <a>4862</a>; common, i.e. (literally) shared by all or several, or (ceremonially) profane:--common, defiled, unclean, unholy." })
NTGreekWord.create({strong_id: 2840, normalized_form: "κοινοω", form: "κοινόω", pos: "Verb", transliteration: "koinoó", phonetic_spelling: "(koy-no'-o)", short_definition: "I make unclean, regard as unclean", medium_definition: "I make unclean, pollute, desecrate, mid: I regard (treat) as unclean.", long_definition: " from koinoV - koinos <a>2839</a>; to make (or consider) profane (ceremonially):--call common, defile, pollute, unclean." })
NTGreekWord.create({strong_id: 2841, normalized_form: "κοινωνεω", form: "κοινωνέω", pos: "Verb", transliteration: "koinóneó", phonetic_spelling: "(koy-no-neh'-o)", short_definition: "I share, communicate, have fellowship with", medium_definition: "(a) I share, communicate, contribute, impart, (b) I share in, have a share of, have fellowship with.", long_definition: " from koinwnoV - koinonos <a>2844</a>; to share with others (objectively or subjectively):--communicate, distribute, be partaker." })
NTGreekWord.create({strong_id: 2842, normalized_form: "κοινωνια", form: "κοινωνία, ας, ἡ", pos: "Noun, Feminine", transliteration: "koinónia", phonetic_spelling: "(koy-nohn-ee'-ah)", short_definition: "participation, communion, fellowship", medium_definition: "(lit: partnership) (a) contributory help, participation, (b) sharing in, communion, (c) spiritual fellowship, a fellowship in the spirit.", long_definition: " from koinwnoV - koinonos <a>2844</a>; partnership, i.e. (literally) participation, or (social) intercourse, or (pecuniary) benefaction:--(to) communicate(-ation), communion, (contri-)distribution, fellowship." })
NTGreekWord.create({strong_id: 2843, normalized_form: "κοινωνικος", form: "κοινωνικός, ή, όν", pos: "Adjective", transliteration: "koinónikos", phonetic_spelling: "(koy-no-nee-kos')", short_definition: "willing to share", medium_definition: "willing to share, sociable, ready to communicate, beneficent.", long_definition: " from koinwnoV - koinonos <a>2844</a>; communicative, i.e. (pecuniarily) liberal:--willing to communicate." })
NTGreekWord.create({strong_id: 2844, normalized_form: "κοινωνος", form: "κοινωνός, οῦ, ὁ, ἡ", pos: "Noun, Masculine", transliteration: "koinónos", phonetic_spelling: "(koy-no-nos')", short_definition: "a sharer, partner", medium_definition: "a sharer, partner, companion.", long_definition: " from koinoV - koinos <a>2839</a>; a sharer, i.e. associate:--companion, X fellowship, partaker, partner." })
NTGreekWord.create({strong_id: 2845, normalized_form: "κοιτη", form: "κοίτη, ης, ἡ", pos: "Noun, Feminine", transliteration: "koité", phonetic_spelling: "(koy'-tay)", short_definition: "a bed, marriage bed", medium_definition: "(a) a bed, (b) a marriage bed; plur: repeated (immoral) sexual intercourse.", long_definition: " from keimai - keimai <a>2749</a>; a couch; by extension, cohabitation; by implication, the male sperm:--bed, chambering, X conceive." })
NTGreekWord.create({strong_id: 2846, normalized_form: "κοιτων", form: "κοιτών, ῶνος, ὁ", pos: "Noun, Masculine", transliteration: "koitón", phonetic_spelling: "(koy-tone')", short_definition: "a bed-chamber", medium_definition: "a bed-chamber.", long_definition: " from koith - koite <a>2845</a>; a bedroom:--+ chamberlain." })
NTGreekWord.create({strong_id: 2847, normalized_form: "κοκκινος", form: "κόκκινος, η, ον", pos: "Adjective", transliteration: "kokkinos", phonetic_spelling: "(kok'-kee-nos)", short_definition: "crimson", medium_definition: "crimson, scarlet, dyed with Kermes (coccum), the female coccus of the Kermes oak.", long_definition: " from kokkoV - kokkos <a>2848</a> (from the kernel-shape of the insect); crimson-colored:--scarlet (colour, coloured)." })
NTGreekWord.create({strong_id: 2848, normalized_form: "κοκκος", form: "κόκκος, ου, ὁ", pos: "Noun, Masculine", transliteration: "kokkos", phonetic_spelling: "(kok'-kos)", short_definition: "a kernel, grain", medium_definition: "a kernel, grain, seed.", long_definition: " apparently a primary word; a kernel of seed:--corn, grain." })
NTGreekWord.create({strong_id: 2849, normalized_form: "κολαζω", form: "κολάζω", pos: "Verb", transliteration: "kolazó", phonetic_spelling: "(kol-ad'-zo)", short_definition: "I chastise, punish", medium_definition: "I chastise, curtail, punish; mid: I cause to be punished.", long_definition: " from kolos (dwarf); properly, to curtail, i.e. (figuratively) to chastise (or reserve for infliction):--punish." })
NTGreekWord.create({strong_id: 2850, normalized_form: "κολακεια", form: "κολακεία, ας, ἡ", pos: "Noun, Feminine", transliteration: "kolakeia", phonetic_spelling: "(kol-ak-i'-ah)", short_definition: "flattery", medium_definition: "flattery, with a view to advantage or gain.", long_definition: " from a derivative of kolax (a fawner); flattery:--X flattering." })
NTGreekWord.create({strong_id: 2851, normalized_form: "κολασις", form: "κόλασις, εως, ἡ", pos: "Noun, Feminine", transliteration: "kolasis", phonetic_spelling: "(kol'-as-is)", short_definition: "chastisement, punishment", medium_definition: "chastisement, punishment, torment, perhaps with the idea of deprivation.", long_definition: " from kolazw - kolazo <a>2849</a>; penal infliction:--punishment, torment." })
NTGreekWord.create({strong_id: 2852, normalized_form: "κολαφιζω", form: "κολαφίζω", pos: "Verb", transliteration: "kolaphizó", phonetic_spelling: "(kol-af-id'-zo)", short_definition: "I strike with the fist, maltreat", medium_definition: "I strike with the fist, buffet; hence: I mistreat violently.", long_definition: " from a derivative of the base of kolazw - kolazo <a>2849</a>; to rap with the fist:--buffet." })
NTGreekWord.create({strong_id: 2853, normalized_form: "κολλαω", form: "κολλάω", pos: "Verb", transliteration: "kollaó", phonetic_spelling: "(kol-lah'-o)", short_definition: "I glue, cleave, keep company with", medium_definition: "(lit: I glue); hence: mid. and pass: I join myself closely, cleave, adhere (to), I keep company (with), of friendly intercourse.", long_definition: " from kolla (\"glue\"); to glue, i.e. (passively or reflexively) to stick (figuratively):--cleave, join (self), keep company." })
NTGreekWord.create({strong_id: 2854, normalized_form: "κολλουριον", form: "κολλούριον, ου, τό", pos: "Noun, Neuter", transliteration: "kollourion", phonetic_spelling: "(kol-loo'-ree-on)", short_definition: "eye-salve", medium_definition: "eye-salve.", long_definition: " neuter of a presumed derivative of kollura (a cake; prob akin to the base of 2853); properly, a poultice (as made of or in the form of crackers), i.e. (by analogy) a plaster:-- eyesalve." })
NTGreekWord.create({strong_id: 2855, normalized_form: "κολλυβιστης", form: "κολλυβιστής, ου, ὁ", pos: "Noun, Masculine", transliteration: "kollubistes", phonetic_spelling: "(kol-loo-bis-tace')", short_definition: "a money-changer", medium_definition: "a money-changer, who changed heathen into Jewish money, for payment into the Temple treasury.", long_definition: " from a presumed derivative of kollubos (a small coin; probably akin to 2854); a coin-dealer:--(money-)changer." })
NTGreekWord.create({strong_id: 2856, normalized_form: "κολοβοω", form: "κολοβόω", pos: "Verb", transliteration: "koloboó", phonetic_spelling: "(kol-ob-o'-o)", short_definition: "I cut short, shorten", medium_definition: "(lit: I maim, mutilate), I cut short, shorten, abbreviate.", long_definition: " from a derivative of the base of kolazw - kolazo <a>2849</a>; to dock, i.e. (figuratively) abridge:--shorten." })
NTGreekWord.create({strong_id: 2857, normalized_form: "Κολοσσαι", form: "Κολοσσαί, ῆς, ἡ", pos: "Noun, Feminine", transliteration: "Kolossai", phonetic_spelling: "(kol-os-sah'-ee)", short_definition: "Colossae", medium_definition: "Colossae, a town of the Roman province Asia, in the Lycus valley, near Laodicea and Hierapolis.", long_definition: " apparently feminine plural of kolossos (\"colossal\"); Colossae, a place in Asia Minor:--Colosse." })
NTGreekWord.create({strong_id: 2858, normalized_form: "Κολοσσαευς", form: "Κολοσσαεύς", pos: "(kol-os-sayoos')", transliteration: "colossians", phonetic_spelling: "", short_definition: "", medium_definition: "", long_definition: " from Kolossai - Kolossai <a>2857</a>; a Colossaean, (i.e. inhabitant of Colossae:--Colossian." })
NTGreekWord.create({strong_id: 2859, normalized_form: "κολπος", form: "κόλπος, ου, ὁ", pos: "Noun, Masculine", transliteration: "kolpos", phonetic_spelling: "(kol'-pos)", short_definition: "bosom, bosom of a garment, a bay, gulf", medium_definition: "(a) sing. and plur: bosom; (sinus) the overhanging fold of the garment used as a pocket, (b) a bay, gulf.", long_definition: " apparently a primary word; the bosom; by analogy, a bay:--bosom, creek." })
NTGreekWord.create({strong_id: 2860, normalized_form: "κολυμβαω", form: "κολυμβάω", pos: "Verb", transliteration: "kolumbaó", phonetic_spelling: "(kol-oom-bah'-o)", short_definition: "I swim", medium_definition: "(properly: I dive, hence) I swim.", long_definition: " from kolumbos (a diver); to plunge into water:--swim." })
NTGreekWord.create({strong_id: 2861, normalized_form: "κολυμβηθρα", form: "κολυμβήθρα, ας, ἡ", pos: "Noun, Feminine", transliteration: "kolumbéthra", phonetic_spelling: "(kol-oom-bay'-thrah)", short_definition: "a pool, swimming-place", medium_definition: "(lit: a diving or swimming place), a pool.", long_definition: " a diving-place, i.e. pond for bathing (or swimming):--pool." })
NTGreekWord.create({strong_id: 2862, normalized_form: "κολωνια", form: "κολωνία, ας, ἡ", pos: "Noun, Feminine", transliteration: "kolónia", phonetic_spelling: "(kol-o-nee'-ah)", short_definition: "a colony, garrison city", medium_definition: "a colony, a city settlement of Roman (soldier) citizens; a garrison city.", long_definition: " of Latin origin; a Roman \"colony\" for veterans:--colony." })
NTGreekWord.create({strong_id: 2863, normalized_form: "κομαω", form: "κομάω", pos: "Verb", transliteration: "komaó", phonetic_spelling: "(kom-ah'-o)", short_definition: "I wear the hair long", medium_definition: "I wear the hair long, allow the hair to grow out.", long_definition: " from komh - kome <a>2864</a>; to wear tresses of hair:--have long hair." })
NTGreekWord.create({strong_id: 2864, normalized_form: "κομη", form: "κόμη, ης, ἡ", pos: "Noun, Feminine", transliteration: "komé", phonetic_spelling: "(kom'-ay)", short_definition: "hair, long hair", medium_definition: "hair, long hair.", long_definition: " apparently from the same as komizw - komizo <a>2359</a>; which properly denotes merely the scalp):--hair." })
NTGreekWord.create({strong_id: 2865, normalized_form: "κομιζω", form: "κομίζω", pos: "Verb", transliteration: "komizó", phonetic_spelling: "(kom-id'-zo)", short_definition: "I bring, receive, recover", medium_definition: "(a) act: I convey, bring, carry, (b) mid: I receive back, receive what has belonged to myself but has been lost, or else promised but kept back, or: I get what has come to be my own by earning, recover.", long_definition: " from a primary komeo (to tend, i.e. take care of); properly, to provide for, i.e. (by implication) to carry off (as if from harm; genitive case obtain):--bring, receive." })
NTGreekWord.create({strong_id: 2866, normalized_form: "κομψοτερον", form: "κομψότερον", pos: "Adverb, Comparative", transliteration: "kompsoteron", phonetic_spelling: "(komp-sot'-er-on)", short_definition: "in better health", medium_definition: "in better health.", long_definition: " neuter comparative of a derivative of the base of komizw - komizo <a>2865</a> (meaning, properly, well dressed, i.e. nice); figuratively, convalescent:--+ began to amend." })
NTGreekWord.create({strong_id: 2867, normalized_form: "κονιαω", form: "κονιάω", pos: "Verb", transliteration: "koniaó", phonetic_spelling: "(kon-ee-ah'-o)", short_definition: "I whitewash", medium_definition: "I whitewash, plaster over.", long_definition: " from konia (dust; by analogy, lime); to whitewash:--whiten." })
