NTGreekWord.create({strong_id: 2869, normalized_form: "κοπαζω", form: "κοπάζω", pos: "Verb", transliteration: "kopazó", phonetic_spelling: "(kop-ad'-zo)", short_definition: "I cease, drop", medium_definition: "I abate, cease raging, am stilled.", long_definition: " from kopoV - kopos <a>2873</a>; to tire, i.e. (figuratively) to relax:--cease." })
NTGreekWord.create({strong_id: 2870, normalized_form: "κοπετος", form: "κοπετός, οῦ, ὁ", pos: "Noun, Masculine", transliteration: "kopetos", phonetic_spelling: "(kop-et-os')", short_definition: "lamentation", medium_definition: "beating of the breast or head in lamentation, lamentation.", long_definition: " from koptw - kopto <a>2875</a>; mourning (properly, by beating the breast):--lamentation." })
NTGreekWord.create({strong_id: 2871, normalized_form: "κοπη", form: "κοπή, ῆς, ἡ", pos: "Noun, Feminine", transliteration: "kopé", phonetic_spelling: "(kop-ay')", short_definition: "slaughter", medium_definition: "slaughter, smiting in battle.", long_definition: " from koptw - kopto <a>2875</a>; cutting, i.e. carnage:--slaughter." })
NTGreekWord.create({strong_id: 2872, normalized_form: "κοπιαω", form: "κοπιάω", pos: "Verb", transliteration: "kopiaó", phonetic_spelling: "(kop-ee-ah'-o)", short_definition: "I grow weary, toil", medium_definition: "(a) I grow weary, (b) I toil, work with effort (of bodily and mental labor alike).", long_definition: " from a derivative of kopoV - kopos <a>2873</a>; to feel fatigue; by implication, to work hard:--(bestow) labour, toil, be wearied." })
NTGreekWord.create({strong_id: 2873, normalized_form: "κοπος", form: "κόπος, ου, ὁ", pos: "Noun, Masculine", transliteration: "kopos", phonetic_spelling: "(kop'-os)", short_definition: "trouble, toil, labor", medium_definition: "(a) trouble, (b) toil, labor, laborious toil, involving weariness and fatigue.", long_definition: " from koptw - kopto <a>2875</a>; a cut, i.e. (by analogy) toil (as reducing the strength), literally or figuratively; by implication, pains:--labour, + trouble, weariness." })
NTGreekWord.create({strong_id: 2874, normalized_form: "κοπρια", form: "κοπρία, ας, ἡ", pos: "Noun, Feminine; Noun, Neuter", transliteration: "kopria", phonetic_spelling: "(kop-ree'-ah)", short_definition: "manure", medium_definition: "manure; a dung-hill.", long_definition: " from kopros (ordure; perhaps akin to 2875); manure:--dung(-hill)." })
NTGreekWord.create({strong_id: 2875, normalized_form: "κοπτω", form: "κόπτω", pos: "Verb", transliteration: "koptó", phonetic_spelling: "(kop'-to)", short_definition: "I cut off, mourn", medium_definition: "(a) I cut, cut off, strike, smite, (b) mid: I beat my breast or head in lamentation, lament, mourn, sometimes with acc. of person whose loss is mourned.", long_definition: " a primary verb; to \"chop\"; specially, to beat the breast in grief:--cut down, lament, mourn, (be-)wail. Compare the base of tomwteroV - tomoteros <a>5114</a>." })
NTGreekWord.create({strong_id: 2876, normalized_form: "κοραξ", form: "κόραξ, ός, ὁ", pos: "Noun, Masculine", transliteration: "korax", phonetic_spelling: "(kor'-ax)", short_definition: "a raven", medium_definition: "a raven, crow.", long_definition: " perhaps from korennumi - korennumi <a>2880</a>; a crow (from its voracity):--raven." })
NTGreekWord.create({strong_id: 2877, normalized_form: "κορασιον", form: "κοράσιον, ου, τό", pos: "Noun, Neuter", transliteration: "korasion", phonetic_spelling: "(kor-as'-ee-on)", short_definition: "a girl, little girl", medium_definition: "a little girl, a young girl; a girl, maiden.", long_definition: " neuter of a presumed derivative of kore (a maiden); a (little) girl:--damsel, maid." })
