NTGreekWord.create({strong_id: 2879, normalized_form: "Κορε", form: "Κορέ, ὁ", pos: "Proper Noun, Indeclinable", transliteration: "Kore", phonetic_spelling: "(kor-eh')", short_definition: "Korah", medium_definition: "(Hebrew) Korah.", long_definition: " of Hebrew origin (Qorach <a>7141</a>; Core (i.e. Korach), an Israelite:--Core." })
NTGreekWord.create({strong_id: 2880, normalized_form: "κορεννυμι", form: "κορέννυμι", pos: "Verb", transliteration: "korennumi", phonetic_spelling: "(kor-en'-noo-mee)", short_definition: "I fill, feed full", medium_definition: "I fill, sate, glut, feed full, satisfy.", long_definition: " a primary verb; to cram, i.e. glut or sate:--eat enough, full." })
NTGreekWord.create({strong_id: 2881, normalized_form: "Κορινθιος", form: "Κορίνθιος, ου, ὁ", pos: "Adjective", transliteration: "Korinthios", phonetic_spelling: "(kor-in'-thee-os)", short_definition: "Corinthian", medium_definition: "Corinthian, of Corinth.", long_definition: " from KorinqoV - Korinthos <a>2882</a>; a Corinthian, i.e. inhabitant of Corinth:--Corinthian." })
