NTGreekWord.create({strong_id: 3326, normalized_form: "μετα", form: "μετά", pos: "Preposition", transliteration: "meta", phonetic_spelling: "(met-ah')", short_definition: "with, after", medium_definition: "(a) gen: with, in company with, (b) acc: (1) behind, beyond, after, of place, (2) after, of time, with nouns, neut. of adjectives.", long_definition: " a primary preposition (often used adverbially); properly, denoting accompaniment; \"amid\" (local or causal); modified variously according to the case (genitive association, or accusative succession) with which it is joined; occupying an intermediate position between apo - apo <a>1722</a> and less close than 4862):--after(-ward), X that he again, against, among, X and, + follow, hence, hereafter, in, of, (up-)on, + our, X and setting, since, (un-)to, + together, when, with (+ -out). Often used in composition, in substantially the same relations of participation or proximity, and transfer or sequence." })
