NTGreekWord.create({strong_id: 3794, normalized_form: "οχυρωμα", form: "ὀχύρωμα, ατος, τό", pos: "Noun, Neuter", transliteration: "ochuróma", phonetic_spelling: "(okh-oo'-ro-mah)", short_definition: "a fortress, strong defense", medium_definition: "a fortress, strong defense, stronghold.", long_definition: " from a remote derivative of ecw - echo <a>2192</a> (meaning to fortify, through the idea of holding safely); a castle (figuratively, argument):--stronghold." })
