NTGreekWord.create({strong_id: 4329, normalized_form: "προσδοκια", form: "προσδοκία, ας, ἡ", pos: "Noun, Feminine", transliteration: "prosdokia", phonetic_spelling: "(pros-dok-ee'-ah)", short_definition: "expectation, waiting", medium_definition: "expectation, waiting.", long_definition: " from prosdokaw - prosdokao <a>4328</a>; apprehension (of evil); by implication, infliction anticipated:--expectation, looking after." })
