NTGreekWord.create({strong_id: 4437, normalized_form: "πυκνος", form: "πυκνός, ή, όν", pos: "Adjective", transliteration: "puknos", phonetic_spelling: "(pook-nos')", short_definition: "frequent, often", medium_definition: "frequent, often, much.", long_definition: " from the same as skhnopoioV - skenopoios <a>4635</a>; clasped (thick), i.e. (figuratively) frequent; neuter plural (as adverb) frequently:--often(-er)." })
NTGreekWord.create({strong_id: 4438, normalized_form: "πυκτευω", form: "πυκτεύω", pos: "Verb", transliteration: "pukteuó", phonetic_spelling: "(pook-teh'-o)", short_definition: "I box", medium_definition: "I box, am a boxer.", long_definition: " from a derivative of the same as pugmh - pugme <a>4435</a>; to box (with the fist), i.e. contend (as a boxer) at the games (figuratively):--fight." })
NTGreekWord.create({strong_id: 4439, normalized_form: "πυλη", form: "πύλη, ης, ἡ", pos: "Noun, Feminine", transliteration: "pulé", phonetic_spelling: "(poo'-lay)", short_definition: "a door, gate", medium_definition: "a gate.", long_definition: " apparently a primary word; a gate, i.e. the leaf or wing of a folding entrance (literally or figuratively):--gate." })
