NTGreekWord.create({strong_id: 4441, normalized_form: "πυνθανομαι", form: "πυνθάνομαι", pos: "Verb", transliteration: "punthanomai", phonetic_spelling: "(poon-than'-om-ahee)", short_definition: "I ask, inquire", medium_definition: "I ask, inquire, ascertain by inquiry, understand.", long_definition: " middle voice prolonged from a primary putho (which occurs only as an alternate in certain tenses); to question, i.e. ascertain by inquiry (as a matter of information merely; and thus differing from erwtaw - erotao <a>1189</a>, which involves the idea of urgent need); by implication, to learn (by casual intelligence):--ask, demand, enquire, understand." })
NTGreekWord.create({strong_id: 4442, normalized_form: "πυρ", form: "πῦρ, πυρός, τό", pos: "Noun, Neuter", transliteration: "pur", phonetic_spelling: "(poor)", short_definition: "fire, trials", medium_definition: "fire; the heat of the sun, lightning; fig: strife, trials; the eternal fire.", long_definition: " a primary word; \"fire\" (literally or figuratively, specially, lightning):--fiery, fire." })
NTGreekWord.create({strong_id: 4443, normalized_form: "πυρα", form: "πυρά, ᾶς, ἡ", pos: "Noun, Feminine", transliteration: "pura", phonetic_spelling: "(poo-rah')", short_definition: "a fire", medium_definition: "a fire, pile of burning fuel.", long_definition: " from pur - pur <a>4442</a>; a fire (concretely):--fire." })
NTGreekWord.create({strong_id: 4444, normalized_form: "πυργος", form: "πύργος, ου, ὁ", pos: "Noun, Masculine", transliteration: "purgos", phonetic_spelling: "(poor'-gos)", short_definition: "a tower, fortified structure", medium_definition: "a tower, fortified structure.", long_definition: " apparently a primary word (\"burgh\"); a tower or castle:--tower." })
