NTGreekWord.create({strong_id: 4446, normalized_form: "πυρετος", form: "πυρετός, οῦ, ὁ", pos: "Noun, Masculine", transliteration: "puretos", phonetic_spelling: "(poo-ret-os')", short_definition: "a fever", medium_definition: "a fever, scorching heat.", long_definition: " from puressw - puresso <a>4445</a>; inflamed, i.e. (by implication) feverish (as noun, fever):--fever." })
