NTGreekWord.create({strong_id: 4450, normalized_form: "πυρος", form: "πυρός, ά, όν", pos: "Adjective", transliteration: "purrhos", phonetic_spelling: "(poor-hros')", short_definition: "red, fire-colored", medium_definition: "red, fire-colored.", long_definition: " from pur - pur <a>4442</a>; fire-like, i.e. (specially), flame- colored:--red." })
