NTGreekWord.create({strong_id: 4715, normalized_form: "στατηρ", form: "στατήρ, ῆρος, ὁ", pos: "Noun, Masculine", transliteration: "statér", phonetic_spelling: "(stat-air')", short_definition: "a Jewish shekel", medium_definition: "an Attic silver coin equal in value to the Jewish shekel.", long_definition: " from the base of kauchsiV - kauchesis <a>2746</a>; a stander (standard of value), i.e. (specially), a stater or certain coin:--piece of money." })
