NTGreekWord.create({strong_id: 4717, normalized_form: "σταυροω", form: "σταυρόω", pos: "Verb", transliteration: "stauroó", phonetic_spelling: "(stow-ro'-o)", short_definition: "I crucify", medium_definition: "I fix to the cross, crucify; fig: I destroy, mortify.", long_definition: " from stauroV - stauros <a>4716</a>; to impale on the cross; figuratively, to extinguish (subdue) passion or selfishness:--crucify." })
NTGreekWord.create({strong_id: 4718, normalized_form: "σταφυλη", form: "σταφυλή, ῆς, ἡ", pos: "Noun, Feminine", transliteration: "staphulé", phonetic_spelling: "(staf-oo-lay')", short_definition: "a grape, cluster of grapes", medium_definition: "a grape, cluster of grapes.", long_definition: " probably from the base of stefanoV - stephanos <a>4735</a>; a cluster of grapes (as if intertwined):--grapes." })
