NTGreekWord.create({strong_id: 4721, normalized_form: "στεγη", form: "στέγη, ης, ἡ", pos: "Noun, Feminine", transliteration: "stegé", phonetic_spelling: "(steg'-ay)", short_definition: "a flat roof of a house", medium_definition: "a flat roof of a house.", long_definition: " strengthened from a primary tegos (a \"thatch\" or \"deck\" of a building); a roof:--roof." })
