NTGreekWord.create({strong_id: 4725, normalized_form: "στεμμα", form: "στέμμα, ατος, τό", pos: "Noun, Neuter", transliteration: "stemma", phonetic_spelling: "(stem'-mah)", short_definition: "a garland", medium_definition: "a garland, wreath, crown.", long_definition: " from the base of stefanoV - stephanos <a>4735</a>; a wreath for show:--garland." })
