NTGreekWord.create({strong_id: 4728, normalized_form: "στενος", form: "στενός, ή, όν", pos: "Adjective", transliteration: "stenos", phonetic_spelling: "(sten-os')", short_definition: "narrow", medium_definition: "narrow, strait.", long_definition: " probably from the base of isthmi - histemi <a>2476</a>; narrow (from obstacles standing close about):--strait." })
