NTGreekWord.create({strong_id: 4735, normalized_form: "στεφανος", form: "στέφανος, ου, ὁ", pos: "Noun, Masculine", transliteration: "stephanos", phonetic_spelling: "(stef'-an-os)", short_definition: "a crown, garland", medium_definition: "a crown, garland, honor, glory.", long_definition: " from an apparently primary stepho (to twine or wreathe); a chaplet (as a badge of royalty, a prize in the public games or a symbol of honor generally; but more conspicuous and elaborate than the simple fillet, 1238), literally or figuratively:--crown." })
