NTGreekWord.create({strong_id: 4746, normalized_form: "στοιβας", form: "στοιβάς, άδος, ἡ", pos: "Noun, Feminine", transliteration: "stoibas", phonetic_spelling: "(stoy-bas')", short_definition: "a bough, branch of a tree", medium_definition: "a bough, branch of a tree.", long_definition: " from a primary steibo (to \"step\" or \"stamp\"); a spread (as if tramped flat) of loose materials for a couch, i.e. (by implication) a bough of a tree so employed:--branch." })
