NTGreekWord.create({strong_id: 4758, normalized_form: "στρατολογεω", form: "στρατολογέω", pos: "Verb", transliteration: "stratologeó", phonetic_spelling: "(strat-ol-og-eh'-o)", short_definition: "I enlist troops", medium_definition: "I collect an army, enlist troops.", long_definition: " from a compound of the base of stratia - stratia <a>3004</a> (in its original sense); to gather (or select) as a warrior, i.e. enlist in the army:--choose to be a soldier." })
NTGreekWord.create({strong_id: 4759, normalized_form: "στρατοπεδαρχης", form: "στρατοπεδάρχης, ου, ὁ", pos: "Noun, Masculine", transliteration: "(strat-op-ed-ar'-khace)", phonetic_spelling: "commander of the Roman emperor's body-guard", short_definition: "commander of the Roman emperor's body-guard.", medium_definition: " ", long_definition: " from stratopedon - stratopedon <a>757</a>; a ruler of an army, i.e. (specially), a Praetorian praefect:--captain of the guard." })
NTGreekWord.create({strong_id: 4760, normalized_form: "στρατοπεδον", form: "στρατόπεδον, ου, τό", pos: "Noun, Neuter", transliteration: "stratopedon", phonetic_spelling: "(strat-op'-ed-on)", short_definition: "an encamped army", medium_definition: "an encamped army.", long_definition: " from the base of stratia - stratia <a>3977</a>; a camping-ground, i.e. (by implication) a body of troops:--army." })
