NTGreekWord.create({strong_id: 4763, normalized_form: "στρηνιαω", form: "στρηνιάω", pos: "Verb", transliteration: "stréniaó", phonetic_spelling: "(stray-nee-ah'-o)", short_definition: "I live luxuriously", medium_definition: "I live luxuriously, revel, riot.", long_definition: " from a presumed derivative of strhnoV - strenos <a>4764</a>; to be luxurious:--live deliciously." })
