NTGreekWord.create({strong_id: 5258, normalized_form: "υπνος", form: "ὕπνος, ου, ὁ", pos: "Noun, Masculine", transliteration: "hupnos", phonetic_spelling: "(hoop'-nos)", short_definition: "sleep", medium_definition: "sleep; fig: spiritual sleep.", long_definition: " from an obsolete primary (perhaps akin to upo - hupo <a>5259</a> through the idea of subsilience); sleep, i.e. (figuratively) spiritual torpor:--sleep." })
NTGreekWord.create({strong_id: 5259, normalized_form: "υπο", form: "ὑπό", pos: "Preposition", transliteration: "hupo", phonetic_spelling: "(hoop-o')", short_definition: "by, under, about", medium_definition: "by, under, about.", long_definition: " a primary preposition; under, i.e. (with the genitive case) of place (beneath), or with verbs (the agency or means, through); (with the accusative case) of place (whither (underneath) or where (below) or time (when (at)):--among, by, from, in, of, under, with. In the comparative, it retains the same general applications, especially of inferior position or condition, and specially, covertly or moderately." })
NTGreekWord.create({strong_id: 5260, normalized_form: "υποβαλλω", form: "ὑποβάλλω", pos: "Verb", transliteration: "hupoballó", phonetic_spelling: "(hoop-ob-al'-lo)", short_definition: "I suborn, instruct privately", medium_definition: "I throw or put under; met: I subject, submit, suggest, whisper, prompt, suborn, instigate.", long_definition: " from upo - hupo <a>906</a>; to throw in stealthily, i.e. introduce by collusion:--suborn." })
