NTGreekWord.create({strong_id: 5262, normalized_form: "υποδειγμα", form: "ὑπόδειγμα, ατος, τό", pos: "Noun, Neuter", transliteration: "hupodeigma", phonetic_spelling: "(hoop-od'-igue-mah)", short_definition: "a figure, copy, example", medium_definition: "(a) a figure, copy, (b) an example, model.", long_definition: " from upodeiknumi - hupodeiknumi <a>5263</a>; an exhibit for imitation or warning (figuratively, specimen, adumbration):--en-(ex-)ample, pattern." })
