NTGreekWord.create({strong_id: 5418, normalized_form: "φραγμος", form: "φραγμός, οῦ, ὁ", pos: "Noun, Masculine", transliteration: "phragmos", phonetic_spelling: "(frag-mos')", short_definition: "a hedge, fence, partition", medium_definition: "a hedge, fence, partition.", long_definition: " from frassw - phrasso <a>5420</a>; a fence, or inclosing barrier (literally or figuratively):--hedge (+ round about), partition." })
NTGreekWord.create({strong_id: 5419, normalized_form: "φραζω", form: "φράζω", pos: "Verb", transliteration: "phrazó", phonetic_spelling: "(frad'-zo)", short_definition: "I declare, explain, interpret", medium_definition: "I declare, explain, interpret.", long_definition: " probably akin to frassw - phrasso <a>5420</a> through the idea of defining; to indicate (by word or act), i.e. (specially), to expound:-- declare." })
NTGreekWord.create({strong_id: 5420, normalized_form: "φρασσω", form: "φράσσω", pos: "Verb", transliteration: "phrassó", phonetic_spelling: "(fras'-so)", short_definition: "I stop, close up", medium_definition: "I stop, close up, obstruct.", long_definition: " apparently a strengthening form of the base of frhn - phren <a>5424</a>; to fence or inclose, i.e. (specially), to block up (figuratively, to silence):--stop." })
NTGreekWord.create({strong_id: 5421, normalized_form: "φρεαρ", form: "φρέαρ, φρέατος, τό", pos: "Noun, Neuter", transliteration: "phrear", phonetic_spelling: "(freh'-ar)", short_definition: "a pit, well", medium_definition: "a pit, well, cistern.", long_definition: " of uncertain derivation; a hole in the ground (dug for obtaining or holding water or other purposes), i.e. a cistern or well; figuratively, an abyss (as a prison):--well, pit." })
NTGreekWord.create({strong_id: 5422, normalized_form: "φρεναπαταω", form: "φρεναπατάω", pos: "Verb", transliteration: "phrenapataó", phonetic_spelling: "(fren-ap-at-ah'-o)", short_definition: "I deceive the mind", medium_definition: "I deceive the mind, impose upon.", long_definition: " from frenapathV - phrenapates <a>5423</a>; to be a mind-misleader, i.e. delude:--deceive." })
NTGreekWord.create({strong_id: 5423, normalized_form: "φρεναπατης", form: "φρεναπάτης, ου, ὁ", pos: "Noun, Masculine", transliteration: "phrenapatés", phonetic_spelling: "(fren-ap-at'-ace)", short_definition: "a mind-deceiver", medium_definition: "a deceiver, seducer.", long_definition: " from frhn - phren <a>539</a>; a mind-misleader, i.e. seducer:--deceiver." })
NTGreekWord.create({strong_id: 5424, normalized_form: "φρην", form: "φρήν, φρενός, ἡ", pos: "Noun, Feminine", transliteration: "phrén", phonetic_spelling: "(frane)", short_definition: "the mind, intellect", medium_definition: "the mind, intellect, thought, understanding.", long_definition: " probably from an obsolete phrao (to rein in or curb; compare 5420); the midrif (as a partition of the body), i.e. (figuratively and by implication, of sympathy) the feelings (or sensitive nature; by extension (also in the plural) the mind or cognitive faculties):--understanding." })
NTGreekWord.create({strong_id: 5425, normalized_form: "φρισσω", form: "φρίσσω", pos: "Verb", transliteration: "phrissó", phonetic_spelling: "(fris'-so)", short_definition: "I shudder", medium_definition: "I shudder, shiver, tremble.", long_definition: " apparently a primary verb; to \"bristle\" or chill, i.e. shudder (fear):--tremble." })
NTGreekWord.create({strong_id: 5426, normalized_form: "φρονεω", form: "φρονέω", pos: "Verb", transliteration: "phroneó", phonetic_spelling: "(fron-eh'-o)", short_definition: "I think, judge, observe", medium_definition: "(a) I think, (b) I think, judge, (c) I direct the mind to, seek for, (d) I observe, (e) I care for.", long_definition: " from frhn - phren <a>5424</a>; to exercise the mind, i.e. entertain or have a sentiment or opinion; by implication, to be (mentally) disposed (more or less earnestly in a certain direction); intensively, to interest oneself in (with concern or obedience):--set the affection on, (be) care(-ful), (be like-, + be of one, + be of the same, + let this) mind(-ed), regard, savour, think." })
NTGreekWord.create({strong_id: 5427, normalized_form: "φρονημα", form: "φρόνημα, ατος, τό", pos: "Noun, Neuter", transliteration: "phronéma", phonetic_spelling: "(fron'-ay-mah)", short_definition: "thought, purpose", medium_definition: "thought, purpose, aspirations.", long_definition: " from fronew - phroneo <a>5426</a>; (mental) inclination or purpose:--(be, + be carnally, + be spiritually) mind(-ed)." })
NTGreekWord.create({strong_id: 5428, normalized_form: "φρονησις", form: "φρόνησις, εως, ἡ", pos: "Noun, Feminine", transliteration: "phronésis", phonetic_spelling: "(fron'-ay-sis)", short_definition: "understanding", medium_definition: "understanding (which leads to right action), practical wisdom, prudence.", long_definition: " from fronew - phroneo <a>5426</a>; mental action or activity, i.e. intellectual or moral insight:--prudence, wisdom." })
NTGreekWord.create({strong_id: 5429, normalized_form: "φρονιμος", form: "φρόνιμος, ον", pos: "Adjective", transliteration: "phronimos", phonetic_spelling: "(fron'-ee-mos)", short_definition: "intelligent, prudent", medium_definition: "intelligent, prudent, sensible, wise.", long_definition: " from frhn - phren <a>4908</a> indicates rather intelligence or mental acquirement); in a bad sense conceited (also in the comparative):--wise(-r)." })
NTGreekWord.create({strong_id: 5430, normalized_form: "φρονιμως", form: "φρονίμως", pos: "Adverb", transliteration: "phronimós", phonetic_spelling: "(fron-im'-oce)", short_definition: "wisely, sensibly, prudently", medium_definition: "wisely, sensibly, prudently.", long_definition: " adverb from fronimoV - phronimos <a>5429</a>; prudently:--wisely." })
NTGreekWord.create({strong_id: 5431, normalized_form: "φροντιζω", form: "φροντίζω", pos: "Verb", transliteration: "phrontizó", phonetic_spelling: "(fron-tid'-zo)", short_definition: "I am thoughtful, careful", medium_definition: "I am thoughtful, careful, give heed.", long_definition: " from a derivative of frhn - phren <a>5424</a>; to exercise thought, i.e. be anxious:--be careful." })
NTGreekWord.create({strong_id: 5432, normalized_form: "φρουρεω", form: "φρουρέω", pos: "Verb", transliteration: "phroureó", phonetic_spelling: "(froo-reh'-o)", short_definition: "I guard, keep", medium_definition: "I guard, keep, as by a military guard.", long_definition: " from a compound of pro - pro <a>5083</a>." })
NTGreekWord.create({strong_id: 5433, normalized_form: "φρυασσω", form: "φρυάσσω", pos: "Verb", transliteration: "phruassó", phonetic_spelling: "(froo-as'-so)", short_definition: "I roar, rage", medium_definition: "I am wanton, insolent; I roar, rage.", long_definition: " akin to bruw - bruo <a>1031</a>; to snort (as a spirited horse), i.e. (figuratively) to make a tumult:--rage." })
NTGreekWord.create({strong_id: 5434, normalized_form: "φρυγανον", form: "φρύγανον, ου, τό", pos: "Noun, Neuter", transliteration: "phruganon", phonetic_spelling: "(froo'-gan-on)", short_definition: "a dry stick for burning", medium_definition: "a dry stick for burning.", long_definition: " neuter of a presumed derivative of phrugo (to roast or parch; akin to the base of 5395); something desiccated, i.e. a dry twig:--stick." })
NTGreekWord.create({strong_id: 5435, normalized_form: "Φρυγια", form: "Φρυγία, ας, ἡ", pos: "Noun, Feminine", transliteration: "Phrugia", phonetic_spelling: "(froog-ee'-ah)", short_definition: "Phrygia", medium_definition: "Phrygia, an ethnic district in Asia Minor, the north-western part of which was in the Roman province Asia and the south-eastern part in the Roman province Galatia.", long_definition: " probably of foreign origin; Phrygia, a region of Asia Minor:--Phrygia." })
NTGreekWord.create({strong_id: 5436, normalized_form: "Φυγελος", form: "Φύγελος, ου, ὁ", pos: "Noun, Masculine", transliteration: "Phugelos", phonetic_spelling: "(foog'-el-los)", short_definition: "Phygelus", medium_definition: "Phygelus, a Christian of the Roman province Asia who deserted Paul.", long_definition: " probably from feugw - pheugo <a>5343</a>; fugitive; Phygellus, an apostate Christian:--Phygellus." })
NTGreekWord.create({strong_id: 5437, normalized_form: "φυγη", form: "φυγή, ῆς, ἡ", pos: "Noun, Feminine", transliteration: "phugé", phonetic_spelling: "(foog-ay')", short_definition: "flight", medium_definition: "flight, fleeing.", long_definition: " from feugw - pheugo <a>5343</a>; a fleeing, i.e. escape:--flight." })
