NTGreekWord.create({strong_id: 5439, normalized_form: "φυλακιζω", form: "φυλακίζω", pos: "Verb", transliteration: "phulakizó", phonetic_spelling: "(foo-lak-id'-zo)", short_definition: "I imprison", medium_definition: "I imprison, deliver into custody.", long_definition: " from fulax - phulax <a>5441</a>; to incarcerate:--imprison." })
NTGreekWord.create({strong_id: 5440, normalized_form: "φυλακτηριον", form: "φυλακτήριον, ου, τό", pos: "Noun, Neuter", transliteration: "phulaktérion", phonetic_spelling: "(foo-lak-tay'-ree-on)", short_definition: "a phylactery, an amulet", medium_definition: "a phylactery, an amulet, a parchment capsule containing little parchment rolls with the Hebrew texts, affixed to the left upper arm or the forehead of men at morning prayer, and regarded as a protection (hence the name) against evil spirits.", long_definition: " neuter of a derivative of fulassw - phulasso <a>5442</a>; a guard-case, i.e. \"phylactery\" for wearing slips of Scripture texts:-- phylactery." })
NTGreekWord.create({strong_id: 5441, normalized_form: "φυλαξ", form: "φύλαξ, ακός, ὁ", pos: "Noun, Masculine", transliteration: "phulax", phonetic_spelling: "(foo'-lax)", short_definition: "a guard, keeper, sentinel", medium_definition: "a guard, keeper, sentinel.", long_definition: " from fulassw - phulasso <a>5442</a>; a watcher or sentry:--keeper." })
NTGreekWord.create({strong_id: 5442, normalized_form: "φυλασσω", form: "φυλάσσω", pos: "Verb", transliteration: "phulassó", phonetic_spelling: "(foo-las'-so)", short_definition: "I keep, guard, observe", medium_definition: "(a) I guard, protect; mid: I am on my guard, (b) act. and mid. of customs and regulations: I keep, observe.", long_definition: " probably from fulh - phule <a>5083</a>." })
NTGreekWord.create({strong_id: 5443, normalized_form: "φυλη", form: "φυλή, ῆς, ἡ", pos: "Noun, Feminine", transliteration: "phulé", phonetic_spelling: "(foo-lay')", short_definition: "a tribe, race", medium_definition: "a tribe or race of people.", long_definition: " from fuw - phuo <a>5453</a> (compare 5444); an offshoot, i.e. race or clan:--kindred, tribe." })
NTGreekWord.create({strong_id: 5444, normalized_form: "φυλλον", form: "φύλλον, ου, τό", pos: "Noun, Neuter", transliteration: "phullon", phonetic_spelling: "(fool'-lon)", short_definition: "a leaf", medium_definition: "a leaf.", long_definition: " from the same as fulh - phule <a>5443</a>; a sprout, i.e. leaf:--leaf." })
NTGreekWord.create({strong_id: 5445, normalized_form: "φυραμα", form: "φύραμα, ατος, τό", pos: "Noun, Neuter", transliteration: "phurama", phonetic_spelling: "(foo'-ram-ah)", short_definition: "a mass or lump", medium_definition: "a mass or lump, as of bread dough.", long_definition: " from a prolonged form of phuro (to mix a liquid with a solid; perhaps akin to fuw - phuo <a>5453</a> through the idea of swelling in bulk), mean to knead; a mass of dough:--lump." })
