NTGreekWord.create({strong_id: 5450, normalized_form: "φυσιωσις", form: "φυσίωσις, εως, ἡ", pos: "Noun, Feminine", transliteration: "phusiósis", phonetic_spelling: "(foo-see'-o-sis)", short_definition: "a puffing up, pride", medium_definition: "a puffing up, pride, swelling.", long_definition: " from fusiow - phusioo <a>5448</a>; inflation, i.e. (figuratively) haughtiness:--swelling." })
