NTGreekWord.create({strong_id: 5455, normalized_form: "φωνεω", form: "φωνέω", pos: "Verb", transliteration: "phóneó", phonetic_spelling: "(fo-neh'-o)", short_definition: "I crow, shout, summon", medium_definition: "I give forth a sound, hence: (a) of a cock: I crow, (b) of men: I shout, (c) trans: I call (to myself), summon; I invite, address.", long_definition: " from fwnh - phone <a>5456</a>; to emit a sound (animal, human or instrumental); by implication, to address in words or by name, also in imitation:--call (for), crow, cry." })
