NTGreekWord.create({strong_id: 5459, normalized_form: "φωσφορος", form: "φωσφόρος, ον", pos: "Adjective", transliteration: "phósphoros", phonetic_spelling: "(foce-for'-os)", short_definition: "light-bearing, radiant, the morning-star", medium_definition: "(lit: light-bearing), radiant, the morning-star.", long_definition: " from fwV - phos <a>5342</a>; light-bearing (\"phosphorus\"), i.e. (specially), the morning-star (figuratively):--day star." })
NTGreekWord.create({strong_id: 5460, normalized_form: "φωτεινος", form: "φωτεινός, ή, όν", pos: "Adjective", transliteration: "phóteinos", phonetic_spelling: "(fo-ti-nos')", short_definition: "bright, luminous, full of light", medium_definition: "bright, luminous, full of light.", long_definition: " from fwV - phos <a>5457</a>; lustrous, i.e. transparent or well-illuminated (figuratively):--bright, full of light." })
