NTGreekWord.create({strong_id: 5462, normalized_form: "φωτισμος", form: "φωτισμός, οῦ, ὁ", pos: "Noun, Masculine", transliteration: "phótismos", phonetic_spelling: "(fo-tis-mos')", short_definition: "light, luster, illumination", medium_definition: "light, luster, illumination, enlightenment.", long_definition: " from fwtizw - photizo <a>5461</a>; illumination (figuratively):--light." })
NTGreekWord.create({strong_id: 5463, normalized_form: "χαιρω", form: "χαίρω", pos: "Verb", transliteration: "chairó", phonetic_spelling: "(khah'-ee-ro)", short_definition: "I rejoice, am glad", medium_definition: "I rejoice, am glad; also a salutation: Hail.", long_definition: "" })
