NTGreekWord.create({strong_id: 5465, normalized_form: "χαλαω", form: "χαλάω", pos: "Verb", transliteration: "chalaó", phonetic_spelling: "(khal-ah'-o)", short_definition: "I let down, lower", medium_definition: "I let down, lower, slacken, loosen.", long_definition: " probably from calaw - chalao <a>5465</a>; hail:--hail." })
NTGreekWord.create({strong_id: 5466, normalized_form: "Χαλδαιος", form: "Χαλδαῖος, ου, ὁ", pos: "Noun, Masculine", transliteration: "Chaldaios", phonetic_spelling: "(khal-dah'-yos)", short_definition: "a Chaldean", medium_definition: "a Chaldean.", long_definition: " from the base of casma - chasma <a>5490</a>; to lower (as into a void):--let down, strike." })
NTGreekWord.create({strong_id: 5467, normalized_form: "χαλεπος", form: "χαλεπός, ή, όν", pos: "Adjective", transliteration: "chalepos", phonetic_spelling: "(khal-ep-os')", short_definition: "hard, harsh, fierce", medium_definition: "(a) hard, troublesome, (b) harsh, fierce.", long_definition: " probably of Hebrew or (Kasdiy <a>3778</a>; a Chaldoean (i.e. Kasdi), or native or the region of the lower Euphrates:--Chaldaean." })
NTGreekWord.create({strong_id: 5468, normalized_form: "χαλιναγωγεω", form: "χαλιναγωγέω", pos: "Verb", transliteration: "chalinagógeó", phonetic_spelling: "(khal-in-ag-ogue-eh'-o)", short_definition: "I bridle, curb", medium_definition: "I bridle, curb, restrain, sway.", long_definition: " perhaps from calaw - chalao <a>5465</a> through the idea of reducing the strength; difficult, i.e. dangerous, or (by implication) furious:--fierce, perilous." })
NTGreekWord.create({strong_id: 5469, normalized_form: "χαλινος", form: "χαλινός, οῦ, ὁ", pos: "Noun, Masculine", transliteration: "chalinos", phonetic_spelling: "(khal-ee-nos')", short_definition: "a bridle", medium_definition: "a bridle, bit.", long_definition: " from a compound of calinoV - chalinos <a>71</a>; to be a bit-leader, i.e. to curb (figuratively):--bridle." })
