NTGreekWord.create({strong_id: 5527, normalized_form: "χορτασμα", form: "χόρτασμα, ατος, τό", pos: "Noun, Neuter", transliteration: "chortasma", phonetic_spelling: "(khor'-tas-mah)", short_definition: "food, sustenance", medium_definition: "food, sustenance, provision.", long_definition: " from cortazw - chortazo <a>5526</a>; forage, i.e. food:--sustenance." })
NTGreekWord.create({strong_id: 5528, normalized_form: "χορτος", form: "χόρτος, ου, ὁ", pos: "Noun, Masculine", transliteration: "chortos", phonetic_spelling: "(khor'-tos)", short_definition: "grass, hay", medium_definition: "grass, herbage, growing grain, hay.", long_definition: " apparently a primary word; a \"court\" or \"garden\", i.e. (by implication, of pasture) herbage or vegetation:--blade, grass, hay." })
NTGreekWord.create({strong_id: 5529, normalized_form: "Χουζας", form: "Χουζᾶς, ᾶ, ὁ", pos: "Noun, Masculine", transliteration: "Chouzas", phonetic_spelling: "(khood-zas')", short_definition: "Chuza", medium_definition: "Chuza, a steward of Herod Antipas.", long_definition: " of uncertain origin; Chuzas, an officer of Herod:--Chuza." })
NTGreekWord.create({strong_id: 5530, normalized_form: "χραομαι", form: "χράομαι", pos: "Verb", transliteration: "chraomai", phonetic_spelling: "(khrah'-om-ahee)", short_definition: "I use, make use of, deal with", medium_definition: "I use, make use of, deal with, take advantage of.", long_definition: " middle voice of a primary verb (perhaps rather from ceir - cheir <a>5534</a>." })
NTGreekWord.create({strong_id: 5531, normalized_form: "χραω", form: "χράω", pos: "Verb", transliteration: "chraó or kichrémi", phonetic_spelling: "(khrah'-o)", short_definition: "I lend", medium_definition: "I lend.", long_definition: " probably the same as the base of craomai - chraomai <a>5530</a>; to loan:--lend." })
NTGreekWord.create({strong_id: 5532, normalized_form: "χρεια", form: "χρεία, ας, ἡ", pos: "Noun, Feminine", transliteration: "chreia", phonetic_spelling: "(khri'-ah)", short_definition: "need, necessity, business", medium_definition: "need, necessity, business.", long_definition: " from the base of craomai - chraomai <a>5534</a>; employment, i.e. an affair; also (by implication) occasion, demand, requirement or destitution:--business, lack, necessary(-ity), need(-ful), use, want." })
NTGreekWord.create({strong_id: 5533, normalized_form: "χρεωφειλετης", form: "χρεωφειλέτης, ου, ὁ", pos: "Noun, Masculine", transliteration: "chreopheiletés", phonetic_spelling: "(khreh-o-fi-let'-ace)", short_definition: "a debtor", medium_definition: "a debtor.", long_definition: " from a derivative of craw - chrao <a>3781</a>; a loan-ower, i.e. indebted person:--debtor." })
NTGreekWord.create({strong_id: 5534, normalized_form: "χρη", form: "χρή", pos: "Verb", transliteration: "chré", phonetic_spelling: "(khray)", short_definition: "it is necessary, proper", medium_definition: "it is necessary, proper, fitting.", long_definition: " third person singular of the same as craomai - chraomai <a>5531</a> used impersonally; it needs (must or should) be:--ought." })
NTGreekWord.create({strong_id: 5535, normalized_form: "χρηιζω", form: "χρῄζω", pos: "Verb", transliteration: "chrézó", phonetic_spelling: "(khrade'-zo)", short_definition: "I need", medium_definition: "I need, have need of, want, desire.", long_definition: " from creia - chreia <a>5532</a>; to make (i.e. have) necessity, i.e. be in want of:--(have) need." })
NTGreekWord.create({strong_id: 5536, normalized_form: "χρημα", form: "χρῆμα, ατος, τό", pos: "Noun, Neuter", transliteration: "chréma", phonetic_spelling: "(khray'-mah)", short_definition: "money, riches", medium_definition: "money, riches, possessions.", long_definition: " something useful or needed, i.e. wealth, price:--money, riches." })
NTGreekWord.create({strong_id: 5537, normalized_form: "χρηματιζω", form: "χρηματίζω", pos: "Verb", transliteration: "chrématizó", phonetic_spelling: "(khray-mat-id'-zo)", short_definition: "I warn, am publicly called", medium_definition: "(originally: I transact business), (a) act. of God: I warn; pass: I am warned by God (probably in response to an inquiry as to one's duty), (b) (I take a name from my public business, hence) I receive a name, am publicly called.", long_definition: " from crhma - chrema <a>5536</a>; to utter an oracle (compare the original sense of 5530), i.e. divinely intimate; by implication, (compare the secular sense of 5532) to constitute a firm for business, i.e. (generally) bear as a title:--be called, be admonished (warned) of God, reveal, speak." })
NTGreekWord.create({strong_id: 5538, normalized_form: "χρηματισμος", form: "χρηματισμός, οῦ, ὁ", pos: "Noun, Masculine", transliteration: "chrématismos", phonetic_spelling: "(khray-mat-is-mos')", short_definition: "an oracle", medium_definition: "an oracle, divine response.", long_definition: " from crhmatizw - chrematizo <a>5537</a>; a divine response or revelation:--answer of God." })
NTGreekWord.create({strong_id: 5539, normalized_form: "χρησιμος", form: "χρήσιμος, η, ον", pos: "Adjective", transliteration: "chrésimos", phonetic_spelling: "(khray'-see-mos)", short_definition: "useful, profitable", medium_definition: "useful, profitable.", long_definition: " from crhsiV - chresis <a>5540</a>; serviceable:--profit." })
NTGreekWord.create({strong_id: 5540, normalized_form: "χρησις", form: "χρῆσις, εως, ἡ", pos: "Noun, Feminine", transliteration: "chrésis", phonetic_spelling: "(khray'-sis)", short_definition: "usage, use", medium_definition: "use, manner of use.", long_definition: " from craomai - chraomai <a>5530</a>; employment, i.e. (specially), sexual intercourse (as an occupation of the body):--use." })
NTGreekWord.create({strong_id: 5541, normalized_form: "χρηστευομαι", form: "χρηστεύομαι", pos: "Verb", transliteration: "chrésteuomai", phonetic_spelling: "(khraste-yoo'-om-ahee)", short_definition: "I am kind", medium_definition: "I am kind (full of service to others), gentle.", long_definition: " middle voice from crhstoV - chrestos <a>5543</a>; to show oneself useful, i.e. act benevolently:--be kind." })
NTGreekWord.create({strong_id: 5542, normalized_form: "χρηστολογια", form: "χρηστολογία, ας, ἡ", pos: "Noun, Feminine", transliteration: "chréstologia", phonetic_spelling: "(khrase-tol-og-ee'-ah)", short_definition: "a kind address", medium_definition: "a kind address; in a bad sense: plausible speaking.", long_definition: " from a compound of crhstoV - chrestos <a>3004</a>; fair speech, i.e. plausibility:--good words." })
NTGreekWord.create({strong_id: 5543, normalized_form: "χρηστος", form: "χρηστός, ή, όν", pos: "Adjective", transliteration: "chréstos", phonetic_spelling: "(khrase-tos')", short_definition: "useful, gentle, pleasant, kind", medium_definition: "useful, gentle, pleasant, kind.", long_definition: " from craomai - chraomai <a>5530</a>; employed, i.e. (by implication) useful (in manner or morals):--better, easy, good(-ness), gracious, kind." })
NTGreekWord.create({strong_id: 5544, normalized_form: "χρηστοτης", form: "χρηστότης, τητος, ἡ", pos: "Noun, Feminine", transliteration: "chréstotés", phonetic_spelling: "(khray-stot'-ace)", short_definition: "goodness, benignity, kindness", medium_definition: "goodness, uprightness, kindness, gentleness.", long_definition: " from crhstoV - chrestos <a>5543</a>; usefulness, i.e. morally, excellence (in character or demeanor):--gentleness, good(-ness), kindness." })
NTGreekWord.create({strong_id: 5545, normalized_form: "χρισμα", form: "χρίσμα, ατος, τό", pos: "Noun, Neuter", transliteration: "chrisma", phonetic_spelling: "(khris'-mah)", short_definition: "an anointing", medium_definition: "an anointing.", long_definition: " from criw - chrio <a>5548</a>; an unguent or smearing, i.e. (figuratively) the special endowment (\"chrism\") of the Holy Spirit:--anointing, unction." })
NTGreekWord.create({strong_id: 5546, normalized_form: "Χριστιανος", form: "Χριστιανός, οῦ, ὁ", pos: "Noun, Masculine", transliteration: "Christianos", phonetic_spelling: "(khris-tee-an-os')", short_definition: "a Christian", medium_definition: "a Christian.", long_definition: " from CristoV - Christos <a>5547</a>; a Christian, i.e. follower of Christ:--Christian." })
NTGreekWord.create({strong_id: 5547, normalized_form: "Χριστος", form: "Χριστός, οῦ, ὁ", pos: "Noun, Masculine", transliteration: "Christos", phonetic_spelling: "(khris-tos')", short_definition: "Anointed One, the Messiah, the Christ", medium_definition: "Anointed One; the Messiah, the Christ.", long_definition: " from criw - chrio <a>5548</a>; anointed, i.e. the Messiah, an epithet of Jesus:--Christ." })
NTGreekWord.create({strong_id: 5548, normalized_form: "χριω", form: "χρίω", pos: "Verb", transliteration: "chrió", phonetic_spelling: "(khree'-o)", short_definition: "I anoint", medium_definition: "I anoint, consecrate by anointing.", long_definition: " probably akin to craomai - chraomai <a>5530</a> through the idea of contact; to smear or rub with oil, i.e. (by implication) to consecrate to an office or religious service:--anoint." })
NTGreekWord.create({strong_id: 5549, normalized_form: "χρονιζω", form: "χρονίζω", pos: "Verb", transliteration: "chronizó", phonetic_spelling: "(khron-id'-zo)", short_definition: "I delay, tarry", medium_definition: "I delay, tarry, linger, spend time.", long_definition: " from cronoV - chronos <a>5550</a>; to take time, i.e. linger:--delay, tarry." })
NTGreekWord.create({strong_id: 5550, normalized_form: "χρονος", form: "χρόνος, ου, ὁ", pos: "Noun, Masculine", transliteration: "chronos", phonetic_spelling: "(khron'-os)", short_definition: "time, a particular time, season", medium_definition: "time, a particular time, season.", long_definition: " of uncertain derivation; a space of time (in general, and thus properly distinguished from kairoV - kairos <a>165</a>, which denotes a particular period) or interval; by extension, an individual opportunity; by implication, delay:--+ years old, season, space, (X often-)time(-s), (a) while." })
NTGreekWord.create({strong_id: 5551, normalized_form: "χρονοτριβεω", form: "χρονοτριβέω", pos: "Verb", transliteration: "chronotribeó", phonetic_spelling: "(khron-ot-rib-eh'-o)", short_definition: "I waste time, spend time", medium_definition: "I waste time, spend time, delay.", long_definition: " from a presumed compound of cronoV - chronos <a>5147</a>; to be a time-wearer, i.e. to procrastinate (linger):--spend time." })
NTGreekWord.create({strong_id: 5552, normalized_form: "χρυσους", form: "χρυσοῦς, ῆ, οῦν", pos: "Adjective", transliteration: "chrusous", phonetic_spelling: "(khroo'-seh-os)", short_definition: "golden", medium_definition: "golden, made of gold, adorned with gold.", long_definition: " from crusoV - chrusos <a>5557</a>; made of gold:--of gold, golden." })
