NTGreekWord.create({strong_id: 5554, normalized_form: "χρυσοδακτυλιος", form: "χρυσοδακτύλιος, ον", pos: "Adjective", transliteration: "chrusodaktulios", phonetic_spelling: "(khroo-sod-ak-too'-lee-os)", short_definition: "adorned with a gold ring", medium_definition: "adorned with a gold ring.", long_definition: " from crusoV - chrusos <a>1146</a>; gold-ringed, i.e. wearing a golden finger-ring or similar jewelry:--with a gold ring." })
NTGreekWord.create({strong_id: 5555, normalized_form: "χρυσολιθος", form: "χρυσόλιθος, ου, ὁ", pos: "Noun, Masculine", transliteration: "chrusolithos", phonetic_spelling: "(khroo-sol'-ee-thos)", short_definition: "a topaz", medium_definition: "a topaz, a gem with a bright yellow color.", long_definition: " from crusoV - chrusos <a>3037</a>; gold-stone, i.e. a yellow gem (\"chrysolite\"):--chrysolite." })
NTGreekWord.create({strong_id: 5556, normalized_form: "χρυσοπρασος", form: "χρυσόπρασος, ου, ὁ", pos: "Noun, Masculine", transliteration: "chrusoprasos", phonetic_spelling: "(khroo-sop'-ras-os)", short_definition: "a chrysoprase", medium_definition: "a chrysoprase, gem of a golden-greenish color.", long_definition: " from crusoV - chrusos <a>5557</a> and prason (a leek); a greenish-yellow gem (\"chrysoprase\"):--chrysoprase." })
NTGreekWord.create({strong_id: 5557, normalized_form: "χρυσος", form: "χρυσός, οῦ, ὁ", pos: "Noun, Masculine", transliteration: "chrusos", phonetic_spelling: "(khroo-sos')", short_definition: "anything made of gold", medium_definition: "gold, anything made of gold, a gold coin.", long_definition: " perhaps from the base of craomai - chraomai <a>5530</a> (through the idea of the utility of the metal); gold; by extension, a golden article, as an ornament or coin:--gold." })
NTGreekWord.create({strong_id: 5558, normalized_form: "χρυσοω", form: "χρυσόω", pos: "Verb", transliteration: "chrusoó", phonetic_spelling: "(khroo-so'-o)", short_definition: "I gild, adorn with gold", medium_definition: "I gild, adorn with gold.", long_definition: " from crusoV - chrusos <a>5557</a>; to gild, i.e. bespangle with golden ornaments:--deck." })
NTGreekWord.create({strong_id: 5559, normalized_form: "χρως", form: "χρώς, ωτός, ὁ", pos: "Noun, Masculine", transliteration: "chrós", phonetic_spelling: "(khroce)", short_definition: "the skin", medium_definition: "the skin, surface of the body.", long_definition: " probably akin to the base of craomai - chraomai <a>5530</a> through the idea of handling; the body (properly, its surface or skin):--body." })
NTGreekWord.create({strong_id: 5560, normalized_form: "χωλος", form: "χωλός, ή, όν", pos: "Adjective", transliteration: "chólos", phonetic_spelling: "(kho-los')", short_definition: "lame, deprived of a foot", medium_definition: "lame, deprived of a foot, limping.", long_definition: " apparently a primary word; \"halt\", i.e. limping:--cripple, halt, lame." })
NTGreekWord.create({strong_id: 5561, normalized_form: "χωρα", form: "χώρα, ας, ἡ", pos: "Noun, Feminine", transliteration: "chóra", phonetic_spelling: "(kho'-rah)", short_definition: "region, land, fields", medium_definition: "(a) a country or region, (b) the land, as opposed to the sea, (c) the country, distinct from town, (d) plur: fields.", long_definition: " feminine of a derivative of the base of casma - chasma <a>5117</a>." })
