NTGreekWord.create({strong_id: 5563, normalized_form: "χωριζω", form: "χωρίζω", pos: "Verb", transliteration: "chórizó", phonetic_spelling: "(kho-rid'-zo)", short_definition: "I separate, depart", medium_definition: "(a) I separate, put apart, (b) mid. or pass: I separate myself, depart, withdraw.", long_definition: " from cwra - chora <a>5561</a>; to place room between, i.e. part; reflexively, to go away:--depart, put asunder, separate." })
