NTGreekWord.create({strong_id: 5565, normalized_form: "χωρις", form: "χωρίς", pos: "Adverb", transliteration: "chóris", phonetic_spelling: "(kho-rece')", short_definition: "apart from, without", medium_definition: "apart from, separately from; without.", long_definition: " adverb from cwra - chora <a>5561</a>; at a space, i.e. separately or apart from (often as preposition):--beside, by itself, without." })
NTGreekWord.create({strong_id: 5566, normalized_form: "χωρος", form: "χῶρος, ου, ὁ", pos: "Noun, Masculine", transliteration: "chóros", phonetic_spelling: "(kho'-ros)", short_definition: "the north-west wind", medium_definition: "the north-west wind, and the quarter of the sky from which it comes.", long_definition: " of Latin origin; the north-west wind:--north west." })
NTGreekWord.create({strong_id: 5567, normalized_form: "ψαλλω", form: "ψάλλω", pos: "Verb", transliteration: "psalló", phonetic_spelling: "(psal'-lo)", short_definition: "I sing psalms", medium_definition: "I sing, sing psalms; earlier: I play on a stringed instrument.", long_definition: "" })
