NTGreekWord.create({strong_id: 5569, normalized_form: "ψευδαδελφος", form: "ψευδάδελφος, ου, ὁ", pos: "Noun, Masculine", transliteration: "pseudadelphos", phonetic_spelling: "(psyoo-dad'-el-fos)", short_definition: "a false brother", medium_definition: "a false brother, pretend Christian.", long_definition: " from yallw - psallo <a>5603</a>." })
