NTGreekWord.create({strong_id: 5572, normalized_form: "ψευδοδιδασκαλος", form: "ψευδοδιδάσκαλος, ου, ὁ", pos: "Noun, Masculine", transliteration: "pseudodidaskalos", phonetic_spelling: "(psyoo-dod-id-as'-kal-os)", short_definition: "a false teacher", medium_definition: "a false teacher, teacher of false things.", long_definition: " from yeudomai - pseudomai <a>5574</a>; untrue, i.e. erroneous, deceitful, wicked:--false, liar." })
