NTGreekWord.create({strong_id: 5577, normalized_form: "ψευδομαρτυρια", form: "ψευδομαρτυρία, ας, ἡ", pos: "Noun, Feminine", transliteration: "pseudomarturia", phonetic_spelling: "(psyoo-dom-ar-too-ree'-ah)", short_definition: "false testimony", medium_definition: "false testimony, false witness.", long_definition: " from yeudomartur - pseudomartur <a>5575</a>; to be an untrue testifier, i.e. offer falsehood in evidence:--be a false witness." })
NTGreekWord.create({strong_id: 5578, normalized_form: "ψευδοπροφητης", form: "ψευδοπροφήτης, ου, ὁ", pos: "Noun, Masculine", transliteration: "pseudoprophétés", phonetic_spelling: "(psyoo-dop-rof-ay'-tace)", short_definition: "a false prophet", medium_definition: "a false prophet; one who in God's name teaches what is false.", long_definition: " from yeudomartur - pseudomartur <a>5575</a>; untrue testimony:--false witness." })
